import { Flex, Avatar, Box, Text } from "@chakra-ui/react";

const Comment = () => {
  return (
    <Flex w="100%">
      <Avatar size="sm" mr={2} />
      <Box bg="gray.300" p={1}>
        <Text fontSize="sm">This is an example of a comment</Text>
      </Box>
    </Flex>
  );
};

export default Comment;
